import React from "react";
import Slider from "react-slick";
import productImg from '../../img/oil.jpg'
import styles from "../ProductsList/ProductsList.module.css";
import Rater from 'react-rater'
import 'react-rater/lib/react-rater.css'
import favorite from '../../img/favorite.svg'
import { sliderSettings } from  './SliderSettings'

const url = 'https://dok.dbroker.com.ua/'

let new_cars = [
  {car: 'Tesla', color: 'Red'},
  {car: 'Bmw', color: 'Black'},
  {car: 'Porsche', color: 'Blue'},
  {car: 'Mersedes', color: 'Pink'},
]

const Card = ({cards}) => {
  const carName = Array.from(new_cars, ({car}) => car)
  return (
    <Slider {...sliderSettings} className={styles.products}>



        {carName}



  </Slider>
  );
};

export default Card;
